import React from 'react'
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import { CardActionArea } from '@mui/material';

function Rutina(props) {
    const {nombre} = props;
  return (
    <Card>
        <CardActionArea>
        {nombre}
        <CardContent>
            <p>Empezar workout</p>
        </CardContent>
        </CardActionArea>    
    </Card>
  )
}

export default Rutina;
